drop schema if exists molkerei;
create schema molkerei;
use molkerei;


create table Customer (
Customer_ID INT,
Customer_Name VARCHAR(50),
Gender VARCHAR(50),
Contact_Number VARCHAR(50),
Address VARCHAR(50),
Email_ID VARCHAR(50),
Password_ VARCHAR(50)
);

create table Employee (
Employee_ID VARCHAR(7),
Employee_Name VARCHAR(50),
Gender VARCHAR(50),
Contact_Number VARCHAR(50),
Emergency_Contact_Number VARCHAR(50),
Address VARCHAR(50),
Email_ID VARCHAR(50),
Passowrd VARCHAR(50),
Medical_Specifics VARCHAR(150),
Pay_Grade VARCHAR(50),
Job_Title VARCHAR(50)
);


create table Category (
Category_Name VARCHAR(50),
Category_ID VARCHAR(3)
);

create table Product (
Product_ID VARCHAR(6),
Category_ID VARCHAR(3),
Product_Name VARCHAR(50),
Product_Type VARCHAR(50),
Price VARCHAR(50)
   
);


create table Coupon (
Coupon_ID VARCHAR(9),
Discount_Percentage VARCHAR(3),
Expiry_Date VARCHAR(10)
);



create table Cart (
Customer_ID INT,
Product_ID VARCHAR(50),
Quantity VARCHAR(50),
Date_Of_Order varchar(10),
Cost VARCHAR(50),
Coupon_ID VARCHAR(50),
Password_ VARCHAR(50),
    foreign key(Customer_ID) references customer(customer_ID)
);

create table Review (
Customer_ID INT,
Rating INT,
Review VARCHAR(15000),
    foreign key(customer_id) references customer(customer_id)
   
);



create table Payment (
Payment_ID VARCHAR(50),
Payment_Mode VARCHAR(50),
Amount VARCHAR(50)
);

create table Shipper (
Shipper_ID VARCHAR(50),
Delievry_Partner VARCHAR(50),
Shipper_Location VARCHAR(50)
);



create table Store (
Store_ID VARCHAR(50),
Store_Name VARCHAR(50),
Manager_Name VARCHAR(50),
Manager_ID VARCHAR(50),
Store_Address VARCHAR(50),
Number_Of_Staff VARCHAR(50)
);

